import React from "react";
import '../App.css';
import { FaFacebook } from "react-icons/fa";
import { FaInstagram } from "react-icons/fa"; 
import {TiSocialLinkedinCircular} from "react-icons/ti";
import {AiFillTwitterCircle} from "react-icons/ai";
import {ImMail4}from "react-icons/im";

const FooterPage = () => {
    return (
        <div className='footer' style={{backgroundColor:'#121212'}}>
            <div className='container'>
            <div className='row'>
                <br />
            </div>
                <div className="row row-cols-3">
                    <div className="col">
                        <h6 className="text-uppercase text-white" style={{marginLeft:'15px'}}>Around the web</h6>
                        <a href="https://facebook.com"><FaFacebook size="30px" color="white" hover="true" className="icons" /></a>
                            &nbsp;
                            <a href="https://instagram.com"><FaInstagram size="30px" color="white" hover="true"/></a>
                            &nbsp;
                            <a href ="https://twitter.com"><AiFillTwitterCircle size="30px" color="white" hover="true" className="icons" /></a>
                            &nbsp;
                            <a href ="https://LinkedIn.com"><TiSocialLinkedinCircular size="40px" color="white" hover="true" className="icons" /></a>
                            &nbsp;
                            <a href ="https://Gmail.com"><ImMail4 size="30px" color="white" hover="true" className="icons" /></a>

                    </div>
                    <div className='col'>
                    <div className="logo2" style={{alignContent:'center'}}>
                </div>
                    </div>
                    <div className="col">
                            <h6 className="text-white text-capatilize" style={{textAlign:"center"}}>ABOUT</h6>
                            <p className="text-white text-capatilize "  >Stocker is a <b>stock analaysis and screening tool</b> to see information of list companies in a very easy way. </p>
                    </div>

                </div>
            </div>
        </div>
    );
}

export default FooterPage;
